Total Rewards
We have a demonstrated history of investing in our workforce by providing competitive wages and benefits. Our benefits package includes:
•comprehensive health insurance coverage to employees working 30 hours or more each week;
•parental leave to all new parents for birth, adoption or foster placement;
•adoption reimbursement of up to $20,000 per employee, per lifetime;
11
•short-term disability to provide wage protection for up to six months;
•a tuition reimbursement program; and
•a 401(k) plan (certain union-affiliated employees participate in a company-sponsored pension or multi-employer plan) with generous company match.
We believe that because employees drive our success, they should share in that success. In addition to competitive wages and benefits, when annual company goals are met, eligible team members at all levels are rewarded with a bonus.
